import React from 'react';
import { Panel, PanelHeader, Group, List, Cell } from '@vkontakte/vkui';

function Catalog () {
  return (
    <Panel id="Catalog">
    <PanelHeader>VKUI</PanelHeader>
    <Group title="Items">
        <List>
        <Cell>Hello</Cell>
        <Cell>World</Cell>
        </List>
    </Group>
    </Panel>
  );
}

export default Catalog;
